import "./App.css";
function App() {
  return (
    <div className="pageWrap">
      <div className="title">
        Hi, my{'\n'}
        name is <div style={{ fontWeight: "800" }}>Khushi!</div>
      </div>
      <div className="subText">
        I'm a second-year{" "}
        <div style={{ fontWeight: "800" }}>Software-Engineering student</div> at
        the University of Waterloo.
      </div>
    </div>
  );
}

export default App;
